import {Component} from '@angular/core';
import {Camera} from '@ionic-native/camera';
import {NavController} from "ionic-angular";
import {HomePage} from "../home/home";

@Component({
  selector: 'page-new-gift',
  templateUrl: 'new-gift.html',
})
export class NewGiftPage {
  public base64Image: string;
  public size: number;

  constructor(private camera: Camera, private _nav: NavController) {
    this.base64Image = "data:image/jpeg;base64,";
    this.updateSize();
  }

  ionViewDidLoad() {
    console.log('ionViewDidLoad NewGiftPage');
  }

  takePicture() {
    this.camera.getPicture({
      destinationType: this.camera.DestinationType.DATA_URL,
      quality: 10,
      targetWidth: 1000,
      targetHeight: 1000
    }).then((imageData) => {
      this.base64Image = "data:image/jpeg;base64," + imageData;
      this.updateSize();
    }, (err) => {
      console.log(err);
    });
  }

  updateSize() {
    this.size = Math.round(this.base64Image.length / 1.33 / 1024);
  }

  addGift() {
    this._nav.setRoot(HomePage);
  }
}
